import React from 'react';
import './App.css';
import {Layout} from 'antd';
import Banner from './components/section-1/banner';
const {Header} = Layout;
function App() {
  return (
    <div className="App">
      <Layout>
        <Header className="header">
          <h1 className="title">Ant Design Rocks!</h1>
        </Header>
        <Banner/>
      </Layout>
    </div>
  );
}

export default App;
